import React, { useState, useEffect } from "react";
import { useLocation } from "react-router-dom";
import "./Rules.css";

const inspectors = [
  { name: "John Doe", lake: "Lugnet", phone: "070-123 45 67" },
  { name: "Jane Doe", lake: "Säbylundssjön", phone: "070-987 65 43" },
  { name: "Abed Balhawan", lake: "Nolsjön", phone: "070-xxx xx xx" }
];

function Contact() {
  const location = useLocation();
  const [activeTab, setActiveTab] = useState("general"); // "general" eller "inspectors"
  const [activeSubTab, setActiveSubTab] = useState("inspectors"); // "inspectors" eller "about"

  useEffect(() => {
    const params = new URLSearchParams(location.search);
    const type = params.get("type");
    if (type === "inspectors" || type === "about") setActiveTab("inspectors");
    if (type) setActiveSubTab(type);
  }, [location]);

  return (
    <div style={{ padding: "20px" }}>
      <h1>Kontakt</h1>

      {/* Flikarna huvud */}
      <div style={{ display: "flex", gap: "15px", marginBottom: "20px" }}>
        <button
          className={activeTab === "general" ? "active-tab" : ""}
          onClick={() => setActiveTab("general")}
        >
          Allmän kontakt
        </button>
        <button
          className={activeTab === "inspectors" ? "active-tab" : ""}
          onClick={() => setActiveTab("inspectors")}
        >
          Tillsynsmän
        </button>
      </div>

      {/* Innehåll för Allmän kontakt */}
      {activeTab === "general" && (
        <div className="rules-container text-break">
          <h2>Allmän kontakt</h2>
          <form>
            <input
              type="text"
              placeholder="Ditt namn"
              style={{ display: "block", marginBottom: "10px", padding: "8px", width: "100%" }}
            />
            <input
              type="email"
              placeholder="Din e-post"
              style={{ display: "block", marginBottom: "10px", padding: "8px", width: "100%" }}
            />
            <textarea
              placeholder="Meddelande"
              style={{ display: "block", marginBottom: "10px", padding: "8px", width: "100%", minHeight: "100px" }}
            />
            <button type="submit" style={{ padding: "10px 20px", cursor: "pointer" }}>Skicka</button>
          </form>
        </div>
      )}

      {/* Innehåll för Tillsynsmän */}
      {activeTab === "inspectors" && (
        <div className="rules-container text-break">
          <div style={{ marginBottom: "15px" }}>
            {/* Dropdown för undersidor */}
            <button
              onClick={() => setActiveSubTab("inspectors")}
              style={{ marginRight: "10px" }}
              className={activeSubTab === "inspectors" ? "active-tab" : ""}
            >
              Tillsynsmän
            </button>
            <button
              onClick={() => setActiveSubTab("about")}
              className={activeSubTab === "about" ? "active-tab" : ""}
            >
              Om oss
            </button>
          </div>

          {/* Visa tillsynsmän */}
          {activeSubTab === "inspectors" && (
            <ul style={{ listStyleType: "none", padding: 0 }}>
              {inspectors.map(ins => (
                <li
                  key={ins.name}
                  style={{
                    backgroundColor: "#f0f8ff",
                    marginBottom: "10px",
                    padding: "10px",
                    borderRadius: "6px",
                    border: "1px solid #ccc"
                  }}
                >
                  <strong>{ins.name}</strong> – {ins.lake} – 📞 {ins.phone}
                </li>
              ))}
            </ul>
          )}

          {/* Visa Om oss */}
          {activeSubTab === "about" && (
            <div>
              <h2>Om oss</h2>
              <p>
                Kumla Sportfiskeförening är en ideell klubb som arbetar för ett hållbart och trevligt fiske i våra sjöar. 
                Vi ordnar aktiviteter för medlemmar, sköter våra vatten och vill skapa en säker och rolig miljö för både barn och vuxna.
                Kontakta oss gärna för mer information om medlemskap eller klubbens verksamhet.
              </p>
            </div>
          )}
        </div>
      )}
    </div>
  );
}

export default Contact;
